    <style>
        *{

            padding: 0;
            margin: 0;
            list-style: none;
            box-sizing: border-box;
            font-family: 'Noto Sans KR', sans-serif;
        }
        body{
            background-color: #fff;
        }
        #align{
            width: 266px;
            /* height: 100vh; */
            margin: 0 auto;
            position: relative;
        }
        #logo{
           /* border: 1px solid red; 나중에 지우기*/
            width: 70px;
            height: 115.1px;
            margin: 148px auto 30.9px auto;
        }
        .inputBox{
            width: 266px;
            height: 45px;
            margin-bottom: 20px;
            position: relative;
            background-color: #f5f5f5;
            border-radius: 4px;
        }
        .inputBox p{
            width: 80%;
            height: 20px;
            position: absolute;
            left: 10%;
            top: 30%;
            font-size: 15px;
        }
        .inputBox img{
            position: absolute;
            left: 85%;
            top: 25%;
            opacity: 0.5;
        }
        #login{
            width: 266px;
            height: 45px;
            text-align: center;
            background-color: #66bb6a;
            background-color: 4px;
            position: relative;
        }
        #login a{
            text-decoration: none;
            color: #fff;
            font-size: 15px;
            position: absolute;
            left: 41%;
            top: 25%;

        }
        #pwRe{
            width: 129px;
            height: 15px;
            text-align: left;
            font-size: 11px;
            display: inline-block;
            margin-top: 8px;
        }
        #pwRe a{text-decoration: none; color: black;}
        #membership{
            width: 50px;
            height: 15px;
            text-align: right;
            font-size: 11px;
            display: inline-block;
            position: absolute;
            right: 0;
            margin-top: 8px;
        }
        #membership a{text-decoration: none; color: black;}
    </style>
</head>
